import React from "react";
import { Formik, Form, Field } from "formik";
export default function NoteForm(props) {
  return (
    <div>
      <Formik
        initialValues={{
          id: "",
          title: "",
          description: "",
          category: "",
        }}
        onSubmit={props.handleSubmittedNote}
      >
        <Form>
          <Field
            name="title"
            placeholder="Title"
            value={Formik.title}
            onChange={Formik.hanleChange}
          />
          <Field name="category" as="select" placeholder="Category">
            <option value="operating_systems">Operating Systems</option>
            <option value="computer_networks">Computer Networks</option>
            <option value="data_structures">Data Structures</option>
            <option value="web_development">Web Development</option>
          </Field>
          <Field name="description" placeholder="Description" />
          <button type="submit">Submit</button>
        </Form>
      </Formik>
    </div>
  );
}
